INSERT INTO `tbl_notice` VALUES ('402880e63cf62235013cf62b3f9e0036','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。\r\n放假前请各位注意关好电脑，关好门窗。提前预祝节日快乐！','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0037','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0038','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0039','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0040','2016年端午节高速免费通知','2016端午节的由来\r\n  端午亦称端五，是我国最大的传统节日之一。“端”的意思和“初”相同，称“端五”也就如称“初五”;端五的“五”字又与“午”相通，按地支顺序推算，五月正是“午”月。又因午时为“阳辰”，所以端五也叫“端阳”。五月五日，月、日都是五，故称重五，也称重午。\r\n  此外，端午还有许多别称，如：夏节、浴兰节、女儿节，天中节、地腊、诗人节等等。端午节的别称之多，间接说明了端午节俗起源的歧出。事实也正是这样的。关于端午节的来源，时至今日有很多种说法。\r\n  2016端午节放假安排高速免费时间表：\r\n  一、元旦：1月1日至3日放假调休，共3天，1月4日(星期一)上班，元旦高速公路不免费。\r\n  二、春节：2月7日至2月13日，共放假7天。高速公路免费时间从2月7日00：00开始，最后一天为2月13日24：00结束。\r\n  三、清明节：4月2日至4日放假调休，共3天。高速公路免费时间为4月2日00：00开始，到4月4日24：00结束。\r\n  四、劳动节：4月30日(周六)至5月2日(周一)放假，共3天。高速公路免费时间为4月30日00：00开始，到5月2日00：00结束。\r\n  五、端午节：6月9(周四)日至11日(周六)放假，共3天。端午节高速公路不免费。\r\n  六、中秋节：9月15日至9月17日，放假三天。中秋节高速公路不免费。\r\n  七、国庆节：10月1日(星期六)至10月7日(星期五)，放假7天。国庆节高速公路免费时间为10月1日00：00开始，到10月7日24：00结束。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0041','矿山地质环境保护与治理恢复方案审查结果公示','根据《国土资源部办公厅关于做好矿山地质环境保护与治理恢复方案编制审查及有关工作的通知》（国土资厅发〔2009〕61号）和《关于矿山地质环境保护与治理恢复方案有关事项的公告》（2014年第21号），我部组织专家对山西潞安环保能源开发股份有限公司王庄煤矿等7个矿山地质环境保护与治理恢复方案（以下简称“方案”）进行了审查。现将拟同意通过的该7个“方案”及专家评审意见进行公示，公示期自发布之日起5个工作日。\r\n如有异议，请在公示期内与国土资源部地质环境司监测处联系。\r\n联系人及电话：李明路 010-66558317/8316（传真）\r\n \r\n  \r\n2016年5月30日\r\n \r\n7个拟通过的矿山地质环境保护\r\n与治理恢复方案\r\n \r\n序号\r\n方案名称\r\n1\r\n山西潞安环保能源开发股份有限公司王庄煤矿矿山地质环境保护与恢复治理方案（修编）\r\n2\r\n国电英力特能源化工集团股份有限公司银星二号煤矿矿山地质环境保护与恢复治理方案\r\n3\r\n青海省大柴旦青龙沟金矿矿山地质环境保护与恢复治理方案\r\n4\r\n中国石油化工股份有限公司中原油田分公司内蒙古二连盆地白音查干凹陷锡林好来油田矿山地质环境保护与恢复治理方案\r\n5\r\n中国石油天然气股份有限公司吉林油田分公司英台油田矿山地质环境保护与恢复治理方案\r\n6\r\n甘肃省金昌市白家嘴子镍铜矿矿山地质环境保护与恢复治理方案\r\n7\r\n陕西省榆林市大梁湾煤矿有限公司大梁湾煤矿矿山地质环境保护与恢复治理方案\r\n','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0042','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0043','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0044','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0045','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0046','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11'),('402880e63cf62235013cf62b3f9e0047','端午放假通知','端午放假时间：2016/06/09-2016/06/11，2016/06/12为正常上班时间。','1','10000001','402880e63cf62235013cf62b3f9e0036','2016-06-05 13:15:11','402880e63cf62235013